function au_s_d(p)
%
%  Deletes the global data that has been generated by 'au_s_i'.
%
%  Calling sequence:
%
%    au_s_d
%
%  Input:
%
%    p         vector containing the ADI shift parameters.
%
%
%  LYAPACK 1.0 (Thilo Penzl, May 1999)

l = length(p);

for i = 1:l

  eval(lp_e( 'global LP_L',i,' LP_U',i ));

  eval(lp_e( 'clear global LP_L',i,' LP_U',i ));

end


